import {handleResponse, handleError} from "./apiUtils";
import axios from 'axios'

const baseUrl = " "

export function submitQuestions(questionData){
    console.log('AXIOSSS')
    return axios.post(baseUrl + 'questions', {
        questionData,
    })
        .then(handleResponse)
        .catch(handleError);
}
